import React from 'react';

function TopBanner() {
  return (
    <div className="row">
      <div className="col-3">
        <img src="./logo192.png" alt="company logo" />
        <div className="col">
          <h1>Hayden's React Site</h1>
        </div>
      </div>
    </div>
  );
}

export default TopBanner;
